import React, { useEffect, useState } from "react";
import axios from "axios";
import WorkoutForm from "./WorkoutForm";
import { useNavigate } from "react-router-dom";

function Dashboard() {
  const navigate = useNavigate();
  const [workouts, setWorkouts] = useState([]);
  const [editing, setEditing] = useState(null);
  const [editForm, setEditForm] = useState({});
  const userToken = localStorage.getItem("token");
  const [userId, setUserId] = useState(null);
  const [quote, setQuote] = useState("");

  useEffect(() => {
    if (!userToken) navigate("/login");
    else {
      const base64Url = userToken.split(".")[1];
      const decoded = JSON.parse(atob(base64Url));
      setUserId(decoded.id);
    }
  }, [userToken, navigate]);

  const quotes = [
    "Push harder than yesterday if you want a different tomorrow!",
    "No pain, no gain!",
    "Strive for progress, not perfection!",
    "Sweat is fat crying!",
    "The body achieves what the mind believes!"
  ];

  const fetchWorkouts = async () => {
    const res = await axios.get("http://localhost:5000/api/workouts", { params: { userId } });
    setWorkouts(res.data);
    setQuote(quotes[Math.floor(Math.random() * quotes.length)]);
  };

  useEffect(() => { if (userId) fetchWorkouts(); }, [userId]);

  const handleDelete = async (id) => {
    if (window.confirm("Delete this workout?")) {
      await axios.delete(`http://localhost:5000/api/workouts/${id}`);
      fetchWorkouts();
    }
  };

  const handleEdit = (workout) => {
    setEditing(workout._id);
    setEditForm({ ...workout });
  };

  const handleEditSubmit = async (e) => {
    e.preventDefault();
    await axios.put(`http://localhost:5000/api/workouts/${editing}`, editForm);
    setEditing(null);
    fetchWorkouts();
  };

  const getTypeColor = (type) => {
    switch (type) {
      case "Cardio": return "badge bg-primary";
      case "Strength": return "badge bg-danger";
      case "Yoga": return "badge bg-success";
      case "HIIT": return "badge bg-warning text-dark";
      case "Stretching": return "badge bg-info text-dark";
      default: return "badge bg-secondary";
    }
  };

  const totalWorkouts = workouts.length;
  const totalMinutes = workouts.reduce((sum, w) => sum + w.duration, 0);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  return (
    <div className="card p-4 shadow">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h3>üèãÔ∏è Gym Dashboard</h3>
        <button className="btn btn-danger btn-sm" onClick={handleLogout}>
          Logout
        </button>
      </div>

      <blockquote className="blockquote text-center text-success mb-4">
        <em>‚Äú{quote}‚Äù</em>
      </blockquote>

      <WorkoutForm userId={userId} onWorkoutAdded={fetchWorkouts} />

      <div className="alert alert-dark text-center mt-3">
        <strong>Weekly Summary:</strong> {totalWorkouts} Workouts | {totalMinutes} Minutes
      </div>

      <h5 className="text-info mb-3">Your Workouts</h5>

      {workouts.length === 0 ? (
        <p className="text-muted">No workouts yet. Add one above!</p>
      ) : (
        <ul className="list-group">
          {workouts.map((w) => (
            <li key={w._id} className="list-group-item bg-dark text-light mb-2 rounded border-success">
              {editing === w._id ? (
                <form onSubmit={handleEditSubmit}>
                  <input
                    className="form-control mb-2"
                    value={editForm.workoutName}
                    onChange={(e) => setEditForm({ ...editForm, workoutName: e.target.value })}
                  />
                  <input
                    className="form-control mb-2"
                    type="number"
                    value={editForm.duration}
                    onChange={(e) => setEditForm({ ...editForm, duration: e.target.value })}
                  />
                  <textarea
                    className="form-control mb-2"
                    value={editForm.notes}
                    onChange={(e) => setEditForm({ ...editForm, notes: e.target.value })}
                  ></textarea>
                  <button className="btn btn-success btn-sm me-2">Save</button>
                  <button className="btn btn-secondary btn-sm" onClick={() => setEditing(null)}>Cancel</button>
                </form>
              ) : (
                <div className="d-flex justify-content-between align-items-center">
                  <div>
                    <strong>{w.workoutName}</strong> ({w.duration} mins){" "}
                    <span className={getTypeColor(w.type)}>{w.type}</span>
                    <br />
                    <small>{new Date(w.date).toLocaleDateString()}</small>
                    {w.notes && <p className="mb-0 text-muted">{w.notes}</p>}
                  </div>
                  <div>
                    <button className="btn btn-outline-warning btn-sm me-2" onClick={() => handleEdit(w)}>‚úèÔ∏è</button>
                    <button className="btn btn-outline-danger btn-sm" onClick={() => handleDelete(w._id)}>üóë</button>
                  </div>
                </div>
              )}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default Dashboard;
